INSERT INTO `events` (`id`, `dato`, `dato_text`, `titel`, `beskrivelse`, `arrangoer`, `kontaktperson`, `kontaktperson_mail`, `lat`, `long`, `stedbeskrivelse`, `synlig`) VALUES
(6, '2013-05-17', 'Fredag den 17 maj 2013', 'Statens Naturhistoriske Museum Bioblitz 2013', '<p>\r\n	P&aring; 1 dag, tog 28 forskere med speciale i alt fra alger til pattedyr, og hj&aelig;lpende h&aelig;nder fra 200 skoleelever, et snapshot af biodiversiteten i hjertet af K&oslash;benhavn.BioBlitz er en f&aelig;lles jagt p&aring; arter, i kapl&oslash;b med tiden. Hvor mange forskellige arter kan man finde i l&oslash;bet af en enkelt dag, p&aring; et enkelt sted? B&oslash;rn, voksne, elever, studerende og museets forskere samarbejdede om at kortl&aelig;gge mangfoldigheden af arter p&aring; en udvalgt lokalitet. Planter, svampe og dyr - alt det liv vi overhovedet kunne finde.Alle indsamlede arter blev bestemt med kvalificeret hj&aelig;lp fra museets forskere og registreret i registreringssystemet her s&aring; resultaterne ogs&aring; kan bruges fremadrettet.Registreringssystemet er udviklet i samarbejde med DanBIF og projektet allearter.dk</p>\r\n', 'Statens Naturhistoriske Museum, Skole- og gymnasietjenesten', 'Mia Lindegaard Pedersen', 'mia.pedersen@snm.ku.dk', '55.69199589384151', '12.58386258139808', 'BioBlitz 2013 fandt sted i Østre Anlæg i København', 1),
