(12, '2014-06-13', 'Fredag d. 13. juni', 'Kalvebod Fælled 2014', '<p>\r\n	<strong>BioBlitz &ndash; find naturens liv</strong></p>\r\n<p>\r\n	<strong>Fredag d. 13. juni 2014 p&aring; Naturcenter Amager p&aring; Kalvebod F&aelig;lled</strong></p>\r\n<p>\r\n	<strong>P&Aring; OPDAGELSE</strong> <strong>BioBlitz er en f&aelig;lles jagt p&aring; arter i kapl&oslash;b med tiden.&nbsp; Hvor mange arter &ndash; planter og dyr &ndash; kan man finde i l&oslash;bet af en enkelt dag p&aring; et enkelt sted? Fredag d. 13. juni 2014 inviterer Naturcenter Amager og Statens Naturhistoriske Museum til BioBlitz p&aring; Kalvebod F&aelig;lled, hvor alle interesserede kan v&aelig;re med til at afd&aelig;kke og registrere artsdiversiteten i samarbejde med et stort hold af naturvejledere og forskere. </strong></p>\r\n<p>\r\n	G&aring; p&aring; opdagelse i naturen med lup, net og kikkert &ndash; til lands, til vands og i luften.</p>\r\n<p>\r\n	- En BioBlitz er et arrangement, hvor vi registrerer s&aring; mange arter som muligt p&aring; &eacute;n dag i et afgr&aelig;nset omr&aring;de. B&aring;de fagfolk og interesserede unders&oslash;ger flora og fauna, og alle fund registreres og kommer til at indg&aring; i en database over alle arter i Danmark, siger Mia Lindegaard Pedersen, naturvejleder p&aring; Statens Naturhistoriske Museum og uddyber:</p>\r\n<p>\r\n	- Det at opdage og beskrive nye arter er en meget vigtig opgave, hvis vi i fremtiden vil sikre naturens mangfoldighed. Vi ved fra vores forskning, at flere arter er truet af udryddelse, og vi har behov for at f&aring; et mere pr&aelig;cist billede af, hvad der findes i naturen, for at vi kan passe ordentligt p&aring; den. Det kan en BioBlitz hj&aelig;lpe os med.</p>\r\n<p>\r\n	Kalvebod F&aelig;lled, hvor BioBlitzen finder sted, har status som national sev&aelig;rdighed og findes p&aring; Margueritteruten. Skoven p&aring; f&aelig;lleden er udpeget til naturskov for at tilgodese vilde dyr og planter. Hele f&aelig;lleden er fredet og kendt for sit mangfoldige dyreliv, s&aelig;rligt vadefuglene har gode ynglemuligheder p&aring; de &aring;bne vidder med s&oslash;er og vandhuller. Insekter, fr&oslash;er, tudser og salamandre har ogs&aring; gode levesteder, bl.a. fordi der ikke spr&oslash;jtes eller g&oslash;des p&aring; f&aelig;lleden. Som eksempel kan n&aelig;vnes at der i 2012 blev fundet en ny sommerfugle art for Danmark i Pinseskoven. Det drejer sig om den smukke Ilia dagsommerfugl, der givetvis yngler i omr&aring;det.</p>\r\n<p>\r\n	Kom med ud og bliv klogere p&aring; hvad der gemmer sig i naturen, hvordan man finder og fanger de forskellige arter og hvordan man ser forskel p&aring; dem. Ved en BioBlitz er alle p&aring; hjemmebane og b&oslash;rnehaver, skoler, familier, studerende, foreninger, naturvejledere og forskere g&aring;r sammen p&aring; opdagelse.&nbsp;</p>\r\n<p>\r\n	God jagt!<br />\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>L&aelig;s mere om BioBlitz p&aring;:</strong> <a href="http://www.bioblitz.dk">www.bioblitz.dk</a></p>\r\n<p>\r\n	<strong>Tid:</strong><br />\r\n	Fredag d. 13. juni 2014 kl. 9-24</p>\r\n<p>\r\n	<strong>Sted:</strong><br />\r\n	Naturcenter Amager<br />\r\n	Kalvebod F&aelig;lled<br />\r\n	Granatvej 1-13<br />\r\n	2770 Kastrup<br />\r\n	<br />\r\n	P-plads v. Otto Baches Alle.</p>\r\n<p>\r\n	<strong>Entr&eacute;:</strong><br />\r\n	Gratis</p>\r\n<p>\r\n	<strong>Arrang&oslash;rer af BioBlitz:</strong><br />\r\n	Statens Naturhistoriske Museum<br />\r\n	Naturcenter Amager<br />\r\n	Naturstyrelsen<br />\r\n	K&oslash;benhavns Naturskole<br />\r\n	T&aring;rnby Naturskole</p>\r\n<p>\r\n	Kontakt:</p>\r\n<p>\r\n	<strong>Mia Lindegaard Pedersen</strong><br />\r\n	Naturvejleder<br />\r\n	Statens Naturhistoriske Museum<br />\r\n	Mail: <a href="mailto:mia.pedersen@snm.ku.dk">mia.pedersen@snm.ku.dk</a><br />\r\n	Mobil: 20 57 10 04</p>\r\n<p>\r\n	<strong>Jes Aagaard</strong><br />\r\n	Naturvejleder<br />\r\n	Naturstyrelsen Hovedstaden<br />\r\n	Mail: <a href="mailto:jaa@nst.dk">jaa@nst.dk</a><br />\r\n	Mobil: 23 73 02 61</p>\r\n<p>\r\n	<strong>Martin Bertelsen</strong><br />\r\n	Kommunikationsmedarbejder<br />\r\n	Statens Naturhistoriske Museum<br />\r\n	Mail: <a href="mailto:mlbertelsen@snm.ku.dk">mlbertelsen@snm.ku.dk</a><br />\r\n	Mobil: 24 48 21 47</p>\r\n', 'Statens Naturhistoriske Museum & Naturcenter Amager', 'Mia Lindegaard Pedersen', 'mia.pedersen@snm.ku.dk', '55.614741963861114', '12.575279474258423', 'Kalvebod Fælled', 0),
(13, '2014-06-13', 'Fredag d. 13. juni 2014', 'Statens Naturhistoriske Museum BioBlitz Kalvebod Fælled 2014', '<p>\r\n	<strong>BioBlitz &ndash; find naturens liv</strong></p>\r\n<p>\r\n	<strong>Fredag d. 13. juni 2014 BioBlitzede forskere, naturvejledere, skoleelever og offentligheden p&aring; Kalvebod F&aelig;lled</strong>.</p>\r\n<p>\r\n	P&aring; Kalvebod F&aelig;lled blev der blitzet p&aring; 2 baser, hhv. ved Naturcentret og ved S&oslash;ndre Pumpe - og der blev endvidere lyslokket i Pinseskoven.<br />\r\n	Tak for indsatsen til skoleelever og l&aelig;rere fra Utterslev Skole, Humleb&aelig;k Skole, Skelg&aring;rdsskolen og Langelinieskolen, forskere og ressourcepersoner fra Statens Naturhistoriske Museum, naturvejledere, formidlere, Entomologisk Forening og g&aelig;ster p&aring; Naturcenter Amager.</p>\r\n<p>\r\n	Se hvad vi fandt under &#39;Alle Fund&#39; herunder.</p>\r\n<p>\r\n	<strong>L&aelig;s mere om Bioblitz p&aring;:</strong> <a href="http://www.bioblitz.dk">www.bioblitz.dk</a></p>\r\n', 'Statens Naturhistoriske Museum & Naturcenter Amager', 'Mia Lindegaard Pedersen', 'mia.pedersen@snm.ku.dk', '55.61476620049539', '12.575258016586304', 'Kalvebod Fælled', 1),
