(16, '2015-09-11', '', 'BioBlitz Sorø 2015', '<p>\r\n	<strong>BioBlitz Sor&oslash;</strong></p>\r\n<p>\r\n	BioBlitz er en f&aelig;lles jagt p&aring; arter i kapl&oslash;b med tiden. Hvor mange arter &ndash; planter og dyr &ndash; kan man finde i l&oslash;bet af en enkelt dag p&aring; et enkelt sted? Fredag d.11. september 2015 inviterer Kongskilde Friluftsg&aring;rd Naturcenter, Naturstyrelsen Storstr&oslash;m, Gr&oslash;nt Forum i Sor&oslash;, DN og &hellip;. til BioBlitz Sor&oslash; p&aring; Kongskilde Friluftsg&aring;rd. Her vil b&oslash;rn og voksne, eksperter og amat&oslash;rer sammen g&aring; p&aring; jagt efter b&aring;de biller, sommerfugle, fisk, mosser, tr&aelig;er, fugle og flagermus.</p>\r\n', 'Kongskilde Friluftsgård Naturcenter', 'Kirsten Blicher Friis', 'nv@d-kf.dk', '', '', 'Kongskilde Friluftsgård', 0),
